Schnelle Reaktionszeit von weniger als 10 Sekunden
"Plug-in-and-Go" senseBox kompatibel
Hohe Auflösung bis zu 0.3µg/m3
Mehrfach wissenschaftliche Prüfung der Datengenauigkeit

